const EnrollStudentView = (props) => {
    const {handleChange, handleSubmit, students, campus } = props;
    console.log(props);
    return(
        <div>
            <h1>Enroll Student to {campus.name}</h1>
            {students.map( student => {
                let name = student.firstname + " " + student.lastname;
                return (
                <div key={student.id}>
                    <input type="checkbox" name={student.id} onChange={handleChange} /> {name}<br />
                </div>
                );
            })}
        </div>
    )
}

export default EnrollStudentView;
